		readMessage: function( event ) {
			if ( 'undefined' === typeof event.event ) {
				return;
			} else if ( 'login' === event.event && event.success ) {
				// Remove any lingering login window
				if ( extWin ) {
					if ( ! extWin.closed ) {
						extWin.close();
